import React from 'react';

function Home() {
    return (
        <div id="home">
            <h1>Create 2D Quizzes</h1>
            <p>Axis lets you create quizzes that place people on a 2-dimensional compass.</p>
            <p>You can define what the x- and y-axes represent, and you're in charge of how</p>
        </div>
    )
}

export default Home
